import Login from "./pages/login/Login.jsx";
import Register from "./pages/register/Register.jsx";

function App() {


  const router = createBrowserRouter([
    {
      path: "/login",
      element: <Login />
    },
    {
      path: "/register",
      element: <Register />
    }
  ])


  return (

  <div>
    <Register />
  </div>
)}

export default App;
